<template>
    <el-tag type="success" effect="dark" class="cursor-pointer" @click="clickPrint">{{currentMailNo | defaultStr}}</el-tag>
</template>

<script>
    import Mustache from 'mustache'
    import JsBarcode from 'jsbarcode'

    export default {
        props: [
            "deliveryInfo",
            "currentMailNo",
            'fromCompanyName',
            'fromAddress',
            'toCompanyName',
            'toAddress',
        ],
        data() {
            return {}
        },
        created() {
        },
        methods: {
            clickPrint() {
                let self = this;
                if(self.deliveryInfo.delivery_company!=='sf_express'){
                    console.log('����˳��')
                    return
                }
                self.loading = true;
                self.$.ajax({
                    url: './static/printTemplate/PrintSfExpressTicket.html',
                    success: function (result) {
                        self.loading = false;
                        let deliveryInfo = {
                            currentMailNo: self.currentMailNo,
                            customerPayCode: self.deliveryInfo.customer_pay_code || null,
                            insurancePrice: self.deliveryInfo.insurance_price,
                            type: self.deliveryInfo.delivery_type.name,
                            primaryMailNo: self.deliveryInfo.primary_mail_no,
                            secondaryMailNo: (self.deliveryInfo.primary_mail_no !== self.currentMailNo) ? self.currentMailNo : null,
                            destinationCode: self.deliveryInfo.destination_code,
                            proCodeIcon: self.deliveryInfo.pro_code==='T1' ? 'data:image/png;base64,'
                                    : self.deliveryInfo.pro_code==='T4' ? 'data:image/png;base64,'
                                            : self.deliveryInfo.pro_code==='T6' ? 'data:image/png;base64,'
                                                    : self.deliveryInfo.pro_code==='T8' ? 'data:image/png;base64,'
                                                            : '',

                            fromAddress: self.fromAddress,
                            toAddress: self.toAddress,
                            fromCompanyName: self.fromCompanyName,
                            toCompanyName: self.toCompanyName,
                            reportCreateTime: self.$moment().format('YYYY-MM-DD HH:mm'),
                            sfLogo: 'data:image/jpeg;base64,'
                        };
                        
                        if(deliveryInfo.fromAddress && deliveryInfo.fromAddress.phone){
                            deliveryInfo.fromAddress.phone = deliveryInfo.fromAddress.phone.slice(0,3)+'****'+deliveryInfo.fromAddress.phone.slice(7)
                        }
                        if(deliveryInfo.toAddress && deliveryInfo.toAddress.phone){
                            deliveryInfo.toAddress.phone = deliveryInfo.toAddress.phone.slice(0,3)+'****'+deliveryInfo.toAddress.phone.slice(7)
                        }
                        let boxTag = Mustache.render(result, {deliveryInfo: deliveryInfo});

                        let popupWin = window.open('', '_blank');
                        popupWin.document.write(boxTag);
                        if(popupWin.document.getElementById('currentMailNoBarCode')){
                            JsBarcode(popupWin.document.getElementById('currentMailNoBarCode'), deliveryInfo.currentMailNo, {
                                height: 30,
                                width: 1.6,
                                fontSize: 14
                            });
                        }
                        if(popupWin.document.getElementById('currentMailNoBarCodeNoValue')) {
                            JsBarcode(popupWin.document.getElementById('currentMailNoBarCodeNoValue'), deliveryInfo.currentMailNo, {
                                displayValue: false,
                                width: 2.2,
                                height: 70
                            });
                        }
                        if(popupWin.document.getElementById('two_dimension_code') && self.deliveryInfo.two_dimension_code) {
                            // eslint-disable-next-line no-undef
                            new QRCode(popupWin.document.getElementById('two_dimension_code'), {
                                text: self.deliveryInfo.two_dimension_code,
                                width: 90,
                                height: 90,
                                // eslint-disable-next-line no-undef
                                correctLevel : QRCode.CorrectLevel.L
                            });
                        }

                    }
                })
            },
        },
    }
</script>

